import React, { useState } from "react";
import { Route, Routes, BrowserRouter } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import NavBar from "./components/content/Navbar";
import SideBar from "./components/sidebar/SideBar";
import Allprojects from "./components/AllProjects.jsx";
import Addproject from "./components/Add.jsx";
import Updateproject from "./components/UpdateProject.jsx";
import SignUp from "./components/SingUp";
import Login from "./components/Login";
import OneProject from "./components/OneProject.jsx";
import Myprojects from "./components/Myprojects";
import Profile from "./components/Profil";
import UpdateProfile from "./components/UpdateProfile";

function App() {
  const [userData, setUserData] = useState({});
  const userIn = (obj) => {
    setUserData(obj);
  };

  return (
    <div className="App wrapper">
      <BrowserRouter>
        <div>
          <div className="nav">
            <img
              className="logo"
              onClick={() => {
                setTrigger(!trigger);
                switchView("productList");
              }}
              src="https://govindjee.store/cdn/shop/collections/high-protein-906413.jpg?v=1679136846"
            />
            <span className="logo"></span>


            <div class="radio-input">
              <p className="ppp">Gainer</p>

              <input
                value="value-1"
                name="value-radio"
                id="value-1"
                type="radio"
                onClick={() => {
                  setData(gainer);
                }}
              />
              <div class="plus1">
                <div class="plus2"></div>
              </div>
              <p className="ppp">Whey</p>
              <input
                value="value-2"
                name="value-radio"
                id="value-2"
                type="radio"
                onClick={() => {
                  setData(whey);
                }}
              />
              <div class="plus1">
                <div class="plus2"></div>
              </div>
              <p className="ppp">Preworkout</p>
              <input
                value="value-3"
                name="value-radio"
                id="value-3"
                type="radio"
                onClick={() => {
                  setData(preworkout);
                }}
              />
              <div class="plus1">
                <div class="plus2"></div>
              </div>

            </div>

            <span
              className="items"
              onClick={() => {
                switchView("cart");
              }}
            >
              🛒
            </span>

            <span
              className="items"
              onClick={() => {
                switchView("login");
              }}
            >
              Admin
            </span>
          </div>
        </div>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Login userIn={userIn} />
              </>
            }
          />
          <Route path="/signup" element={<SignUp />} />
          <Route path="/allprojects" element={<Allprojects />} />
          <Route path="/allproject/oneproject" element={<OneProject />} />
          <Route
            path="/myprojects"
            element={<Myprojects userData={userData} />}
          />
          <Route path="/myprojects/addproject" element={<Addproject />} />
          <Route path="/myprojects/updateproject" element={<Updateproject />} />
          <Route path="/profile" element={<Profile userData={userData} />} />
          <Route path="/profile/updateprofile" element={<UpdateProfile />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
